import React from 'react'
import './HeaderNav.css'
import BackButton from './images/thenounproject.png'

function HeaderNav() {
    return (
        <div className='row headerNav'>
            <div className="col">
                <img src={BackButton} alt="back" />
            </div>
        </div>
    )
}

export default HeaderNav
